import styled from "styled-components";
import React from "react";
import ReactDOM from "react-dom";

const Sc_img = styled.img`
 width:200px
        height:200px
`;

function Foods(props) {
  const { data } = props;
  return (
    <div className="foods">
      {data.map((items) => (
        <img src={items.img} />
      ))}
    </div>
  );
}

export default Foods;
